# from mysql_connect import connect_dbfrom db_ac.modular.mapper import connect_DB# import pymysqlwms_db = "ods_mysql"inserSql = """INSERT INTO `ews`.`outbound_group_config` (`id`, `delivery_type`, `batch_model`, `group_type`, `priority`, `is_limit`,                                           `limit_quantity`, `is_open`, `is_hint`, `processcenter_id`, `create_date`,                                           `create_user_id`, `create_user_name`, `modify_date`, `modify_user_id`,                                           `modify_user_name`, `is_deleted`, `delete_date`, `delete_user_id`,                                           `lock_version`, `modify_time_stamp`, `is_used`, `is_partial`)VALUES ('{0}', '{1}', '{2}', '{3}', '2', '1', '1', '1', '1', '{4}', '1970-01-01 00:00:00', '0', '',        '2020-10-21 16:51:49', '656071542958202880', '朱志亮', '0', '1970-01-01 00:00:00', '0', '0', '2020-10-21 16:51:48',        '{5}', '0');"""def inserOutbountConfig(delivery_type,processcenter):    cursor = connect_DB(wms_db)    selectSql = 'select * from outbound_group_config ORDER BY id DESC LIMIT 1 '    newId=int(cursor.fetchone(selectSql)[0])+1    # newId=85974589388221085    # print(newId)    for i in range(0,9):        print(i)        if i <=5:            cursor.execute(inserSql.format(newId + i, delivery_type, 0, i+1, processcenter,1))        else:            cursor.execute(inserSql.format(newId + i, delivery_type, 1, i-4, processcenter,0))    cursor.commitAndClose()if __name__=="__main__":    #设置处理中心     processcenter = 934    #设置销售类型    delivery_type = 0    inserOutbountConfig(delivery_type,processcenter)# t '0销售出库,1样品出库,2调拨出库,3清货出库,4盘损出库,5返修出库,6退件出库,7报损出库,8移库出库,9重构出库,10退货出库